import React, {useState} from "react";

function UserState() 
{
    const [count, setCount] = useState(0)

    return(
        <div>
            <h1>React</h1>
            <p>{count}</p>
            <button onClick={() => setCount(count + 1)}>Update</button>
        </div>
    )
}

export default UserState
